<!DOCTYPE html>
<html lang="en">

<head>
	<meta charset="UTF-8">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<meta http-equiv="X-UA-Compatible" content="ie=edge">
	<title>Ваш браузер устарел!</title>
	<style>
		html,
		body,
		* {
			margin: 0;
			padding: 0;
			-webkit-box-sizing: border-box;
			box-sizing: border-box;
			font-family: "MTS Sans", Arial, Helvetica, sans-serif;
			color: #202D3D;
		}

		ul, li {
			list-style: none;
		}

		@font-face {
			font-family: 'MTS Sans';
			src: url("/local/templates/updated-design/fonts/MTSSans-Regular.woff") format("woff");
			font-weight: 400;
			font-style: normal;
		}

		@font-face {
			font-family: 'MTS Sans';
			src: url("/local/templates/updated-design/fonts/MTSSans-Medium.woff") format("woff");
			font-weight: 600;
			font-style: normal;
		}

		@font-face {
			font-family: 'MTS Sans';
			src: url("/local/templates/updated-design/fonts/MTSSans-Bold.woff") format("woff");
			font-weight: 700;
			font-style: normal;
		}

		.notification {
			padding: 40px 20px;
			text-align: center;
			font-size: 14px;
		}

		.notification__logo {
			margin-bottom: 50px;
		}

		.notification__logo_link {
			display: inline-block;
		}

		.notification__title {
			font-family: "MTS Sans", Arial, Helvetica, sans-serif;
			font-weight: 700;
			font-size: 32px;
			line-height: 52px;
			letter-spacing: -1px;
			text-transform: none;
			margin-bottom: 25px;
		}

		.notification__logo img {
			margin: 0 auto;
			display: block;
		}

		.notification__text {
			margin-bottom: 25px;
		}

		.browsers__item {
			display: inline-block;
			margin: 0 10px;
		}

		.browsers__name {
			font-size: 10px;
			color: #9198A0;
		}

		.browsers__icon {
			margin-bottom: 25px;
			display: block;
			text-decoration: none;
		}

		.browsers__icon img {
			margin: 0 auto;
			display: block;
			width: 30px;
		}

		@media screen and (min-width: 1024px) {
			.notification {
				font-size: 20px;
				padding: 40px 20px;
			}

			.notification__title {
				font-size: 48px;
			}

			.notification__logo {
				margin-bottom: 180px;
			}

			.browsers__item {
				margin: 0 20px;
				width: 60px;
			}

			.browsers__name {
				font-size: 14px;
			}

			.browsers__icon img {
				width: 60px;
			}
		}
	</style>
</head>

